import React from "react";

import {
	NavbarContainer,
	NavbarWrap,
	NavbarDireita,
	NavbarEsquerda,
} from "./NavbarElementos";

const Navbar = () => {
	return (
		<NavbarContainer>
			<NavbarWrap>
				<NavbarEsquerda>esquerda</NavbarEsquerda>
				<NavbarDireita>direita</NavbarDireita>
			</NavbarWrap>
		</NavbarContainer>
	);
};

export default Navbar;
